import { Icon } from "@iconify/react";
export const Buttons =[{
    btnName : 'Dashboard',
    btnIcon : '<Icon icon="humbleicons:dashboard" width="24" rotate={1} hFlip={true} vFlip={true} />'
},{
    btnName : 'Dashboard',
    btnIcon : '<Icon icon="humbleicons:dashboard" width="24" rotate={1} hFlip={true} vFlip={true} />',
    second :true
}
]
